import Listbox from "../../../components/listbox/Listbox"

const NetworkMenu = () => {

  const chains = [
    { name: 'Arbitrum' },
    { name: 'Goerli' },
  ]

  return (
    <Listbox items={chains} />
  )
}

export default NetworkMenu
